    color: "rgba(0,0,0,1)",
    fontSize: 40,
  },
  savedCustomersTxt: {
    fontWeight: "700",
    color: "#121212",
    fontSize: 20,
  },
  bottomGroup: {
    width: 439,
    height: 454,
    justifyContent: "space-around",
    alignItems: "center",
  },
  searchSavedCustomersBox: {
    width: 439,
    height: 54,
    backgroundColor: "rgba(255,255,255,1)",
    borderRadius: 10,
    borderWidth: 1,
    borderColor: "#000000",
    padding: 10,
  },
  scrollArea: {
    width: 439,
    height: 325,
  },
  scrollArea_contentContainerStyle: {
